import './products.css';
import { Link } from 'react-router-dom';


function Products() {
  return (
    <div className="App">
      <header>
        <div className="product-item">
          <img src= "product1.jpeg" 
            alt="Product"
          />
          <h2>Product Title</h2>
          <p>Product Description</p>
          <Link to="/orders">Order Now</Link>
        </div>
      </header>
    </div>
  );
}

export default Products;
